import React from "react";
import { Route, Switch } from "react-router-dom"; // Importez Route et Switch de React Router
import PublicPage from "./PublicPage";
import ParticipantPage from "./ParticipantPage";

const App = () => {
  return (
    <div>
      <Switch>
        {" "}
        {/* Utilisez Switch pour gérer les itinéraires exclusivement */}
        <Route path="/participants" component={ParticipantPage} />{" "}
        {/* Chemin vers la page des participants */}
        <Route path="/" component={PublicPage} /> {/* Chemin par défaut */}
      </Switch>
    </div>
  );
};

export default App;
